import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render(){
    return(
      <div className="App">
        <h3>Ini project pertama ReactJS</h3>
        <p>Belajar ReactJS itu mudah</p>
      </div>
    );
  }
}

export default App;
